import axios from 'axios';

const KEY = 'sR2ednXBc8';

export default axios.create({
  baseURL: 'https://www.magayo.com/api/results.php',
  params: {
    headers: { 'Access-Control-Allow-Origin': '*' },
    api_key: KEY,
    game: 'us_fl_cash3_eve',
    format: 'JSON',
    mode: 'no-cors',
  },
});
